def mobileEasyuiTree(request):
    if request.method=='POST':
        if request.POST.has_key('id'):
            id = request.POST['id']
            childObjList = coordinates_table.objects.filter(ParentIdent=id)
        else:
            childObjList = coordinates_table.objects.filter(Level=0)

        data = []
        for childObj in childObjList:
            id = childObj.ElementIdent
            text = childObj.Name
            type = childObj.Type
            if type==0:
                #children = []
                state = 'closed'
            else:
                #children = None
                state = 'open'

            data.append({"id":id,"text":text,"state":state})

        return JsonResponse(data,safe=False)


