def ztreegetdata(request):
    if request.method=='POST':
        import pdb;pdb.set_trace()
        if request.POST.has_key('pk'):
            pk = request.POST['pk']
            level0ObjList = coordinates_table.objects.filter(ParentIdent=pk)
